import React from 'react';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import 'bootstrap/dist/css/bootstrap.min.css';
import SelectBar from "./Components/SelectBar";
import SwitchBar from "./Components/SwitchBar";
import {FaRegBookmark} from "react-icons/all";
import {BrowserRouter as Router,
Switch,
Route,
Link,
} from "react-router-dom";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {apiResponse: ""};
    }

    callAPI() {
        fetch("http://localhost:9000/test")
            .then(res => res.text())
            .then(res => this.setState({apiResponse: res}))
    }

    componentWillMount() {
        this.callAPI();
    }

    render() {
        return (
            <div>
                <Navbar bg="dark" variant="dark" style={{paddingLeft: '0'}}>
                    <SelectBar/>
                    <Nav className="mr-auto">
                        <Nav.Link href="/Routers/Home">Home</Nav.Link>
                        <Nav.Link href="#">World</Nav.Link>
                        <Nav.Link href="#">Politics</Nav.Link>
                        <Nav.Link href="#">Business</Nav.Link>
                        <Nav.Link href="#">Technology</Nav.Link>
                        <Nav.Link href="#">Sports</Nav.Link>
                    </Nav>
                    <FaRegBookmark color="white" className="mr-2"/>
                    <Navbar.Text style={{color: 'white'}} className="mr-2">NYTimes</Navbar.Text>
                    <SwitchBar/>
                    <Navbar.Text style={{color: 'white'}}>Guardian</Navbar.Text>
                </Navbar>
            </div>
        );
    }
}

export default App;
